import React, { useState,useEffect } from 'react'
import axios from 'axios';
const Read = () => {
    const[data,setData]=useState([]);
    function getData(){
        axios.get("https://6449e5fe79279846dcda7b28.mockapi.io/crud-youtuber")
        .then((res)=>{
            setData(res.data);
        })
    }
    useEffect=(()=>{

        getData();
    },[data]);

  return (
    <>
         <h2>Read Operation</h2>
        <table class="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Name</th>
      <th scope="col">Email</th>
      <th scope="col"></th>
      <th scope="col"></th>
    </tr>
  </thead>
  {
    data.map((eachdata)=>{
        return(
            <>
             <tbody>
    <tr>
      <th scope="row">{eachdata.id}</th>
      <td>{eachdata.name}</td>
      <td>{eachdata.email}</td>
      <td><button className="btn-success">Edit</button></td>
      <td><button className="btn-danger">Delete</button></td>
    </tr>


  </tbody>
            </>
        )
    })
  }
</table>

    </>
  )
}

export default Read
